import React, { Component } from 'react';
import NavList from '../block/NavList';

export default function Footer() {
    const FooterStyle = {
        background: "#333"

    }
    const NavStyle = {
        display: "flex"
    }
    return (
        <footer>
            <div style={ FooterStyle }>
                <a href="/">
                    <div class="logo">
                        黒猫ノンちゃん
                    </div>
                </a>

                <NavList style={ NavStyle } />
            </div>
        </footer>
    );
}
